import React from 'react';

const NetworkModal = ({ network, onClose }) => {
  return (
    <div className="modal">
      <div className="modal-content">
        <h2>Network Details</h2>
        <p><strong>ID:</strong> {network.id || 'N/A'}</p>
        <p><strong>Name:</strong> {network.name || 'N/A'}</p>
        <p><strong>Description:</strong> {network.description || 'N/A'}</p>
        <p><strong>Color:</strong> {network.color || 'N/A'}</p>
        <div
          style={{
            backgroundColor: network.color || '#FFFFFF',
            width: '50px',
            height: '20px',
            border: '1px solid #000'
          }}
        ></div>
        <p>
          <strong>Color Preview:</strong>
          {network.color ? (
            <span
              style={{
                display: 'inline-block',
                width: '20px',
                height: '20px',
                backgroundColor: network.color,
                marginLeft: '10px',
                border: '1px solid #000',
              }}
            ></span>
          ) : (
            ' N/A'
          )}
        </p>
        <p><strong>Created At:</strong> {network.created_at || 'N/A'}</p>
        <button onClick={onClose}>Close</button>
      </div>
    </div>
  );
};

export default NetworkModal;
